PREFIX geo: <http://www.w3.org/2003/01/geo/wgs84_pos#>
PREFIX schema: <http://schema.org/>

SELECT?city?distance
WHERE {
 ?house schema:name "David W. Brown House" ;
         geo:lat?houseLat ;
         geo:long?houseLong.

 ?city schema:population?population ;
        geo:lat?cityLat ;
        geo:long?cityLong.

  BIND((acos(sin(?houseLat)*sin(?cityLat) + cos(?houseLat)*cos(?cityLat)*cos(?cityLong -?houseLong)) * 6371) as?distance)
}
ORDER BY?distance
LIMIT 1

